import React, { useState } from 'react';

const Filter = () => {
  const [isPopupOpen, setPopupOpen] = useState(false);

  const handleRatingButtonClick = () => {
    setPopupOpen(!isPopupOpen);
  };

  const handleSort = (order) => {
    // Implement your sorting logic based on the 'order' parameter
    console.log(`Sorting ratings in ${order} order`);
    setPopupOpen(false);
  };

  return (
    <div className="patient-web-app__sc-1xpo6zd-12 gSFgra">
      <div data-test="" className="patient-web-app__sc-1mzfv3y-10 hkILqW">
        <div
          tabIndex="0"
          role="button"
          aria-pressed="false"
          className="patient-web-app__sc-1xpo6zd-0 djNeDv"
        >
          <div
            data-test="facet-chip-button"
            className="patient-web-app__sc-1xpo6zd-3 coypUp"
            onClick={handleRatingButtonClick}
          >
            Rating
          </div>
          <div
            data-test="facet-chip-clear-btn"
            hidden={!isPopupOpen}
            className="patient-web-app__sc-1xpo6zd-1 kyxhbV"
          >
            <div className="popup">
              <button onClick={() => handleSort('ascending')}>Sort Ascending</button>
              <button onClick={() => handleSort('descending')}>Sort Descending</button>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Filter;
